import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
  return (
    <div className='ui one column centered grid'>
      <div className='ui large header centered row'>Under Construction</div>
      <div className='ui segment'>
        <i className='icon github'><a href='https://github.com/isand3r' /></i>
      </div>
    </div>
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
)
